svg.script:
//
//TODO: Minify JS code
//TODO: Remove console.log() output
var iconicApis = window._Iconic ? window._Iconic.smartIconApis : {};
iconicApis["histogram"] = iconicApis["histogram"] || function(t) {

    window.logging = true;

    $c().log("Staring histogram ...");

    var f1 = function(degreeOfSmoothing) {

        $c().log("degreeOfSmoothing is: " + degreeOfSmoothing);

        var smoothing = 0;
        if (! isNaN(degreeOfSmoothing)) smoothing = parseInt(degreeOfSmoothing);

        t.setAttribute("data-degree-of-smoothing", smoothing);

        $c().log("Smoothing value is: " + smoothing);

        var attr = "default";
        switch (smoothing) {

            case -2:
                attr = "least";
                break;
            case -1:
                attr = "less";
                break;
            case 1:
                attr = "more";
                break;
            case 2:
                attr = "most";
                break;
            case 0:
            default:
                attr = "default";
                break;
        }

        $c(t).off([".iconic-histogram-smoothing"]);
        $c(t).on([".iconic-histogram-smoothing-" + attr]);
    };
    var f2 = function() {
        var e = t.getAttribute("data-degree-of-smoothing");
        e && f1(e)
    };
    return {
        update: f2,
        setDegreeOfSmoothing: f1
    }
};
//
